import { createApp } from '../client/app';
import { get, isFunction } from 'lodash';

export default context => {
    return new Promise((resolve, reject) => {
        const { app, router, store } = createApp();
        const path = get(context, 'request.url', '');
        const query = get(context, 'request.query', {});
        if (!path) {
            return reject();
        }
        router.push(path);
        router.onReady(() => {
            const asyncComponents = router.getMatchedComponents();
            if (asyncComponents.length === 0) {
                return reject();
            }
            Promise.all(asyncComponents.map(component => {
                const preFetch = get(component, 'preFetch');
                if (preFetch && isFunction(preFetch)) {
                    return preFetch(store, query);
                } else {
                    return Promise.reject()
                }
            })).then(() => {
                context.state = store.state;
                return resolve(app);
            }).catch(e => {
                return reject()
            });
        }, () => {
            return reject();
        })
    })
}

